import { Backdrop, CircularProgress } from '@mui/material';
import React, { useState } from 'react';

function TopTickerComp() {
    var Today = new Date()
    const todayDate = Today.getFullYear() + "-" + String(Today.getMonth()+1).padStart(2, '0') + "-" + String(Today.getDate()).padStart(2, '0')

    const [startDate, setStartDate] = useState(todayDate)
    const [endDate, setEndDate] = useState(todayDate)
    const [top, setTop] = useState(5)
    const [recommend, setRecommend] = useState("all")
    const [category, setCategory] = useState("all")
    const [type, setType] = useState("all")
    const [loading, setLoading] = useState(false)

    return (
        <>
            <Backdrop
                sx = {{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 1 }}
                open = { loading }
            >
                資料載入中&emsp;
                <CircularProgress color = "inherit" />
            </Backdrop>

            <div className = 'row mx-auto py-3'>
                <div className = 'col-md-8 mx-auto'>
                    <h3 className = "display-6 text-center">熱門個股研究報告</h3>
                </div>

                <form onSubmit = { submit }>
                    <div className = 'form-group row py-3'>
                        <label htmlFor = "startDate" className = "col-md-3 col-form-label text-center">開始日期:</label>
                        <div className = 'col-md-3'>
                            <input type = "date" id = "startDate" className = "form-control" 
                                onChange = {e => setStartDate(e.target.value)} value = { startDate }></input>
                        </div>
                    </div>

                    <div className = 'form-group row py-3'>
                        <label htmlFor = "endDate" className = "col-md-3 col-form-label text-center">結束日期:</label>
                        <div className = 'col-md-3'>
                            <input type = "date" id = "endDate" className = "form-control" 
                                onChange = {e => setEndDate(e.target.value)} value = { endDate }></input>
                        </div>
                    </div>

                    <div className = 'form-group row py-3'>
                        <label htmlFor = "top" className = "col-md-3 col-form-label">熱門股票筆數:</label>
                        <div className = 'col-md-3'>
                            <select id = "top" className = "form-select" onChange = {e => {
                                setTop(e.target.value)
                            }}>
                                <option value = "5">5</option>
                                <option value = "10">10</option>
                                <option value = "15">15</option>
                            </select>
                        </div>
                    </div>

                    <div className = 'form-group row py-3'>
                        <label htmlFor = "method" className = "col-md-3 col-form-label">投資建議:</label>
                        <div className = 'col-md-3'>
                            <select id = "method" className = "form-select" onChange = {e => setRecommend(e.target.value)}>
                                <option value = "method1">全部</option>
                                <option value = "method2">方法二</option>
                                <option value = "method3">方法三</option>
                            </select>
                        </div>
                    </div>

                    <div className = 'form-group row py-3'>
                        <div className = 'col-md-12 text-center'>
                            <button type = "submit" className = "btn btn-primary" style = {{ width : "100px" }}>搜尋</button>
                        </div>
                    </div>
                </form>
            </div>
        </>
    );
}

export default TopTickerComp;
